import './App.css';
import Home from './components/Home';
import UserHome from './components/User/UserHome';
function App() {
  return (

    <div class ="container-fuid" className="App">
      <Routes>
        <Route path="" element={<Home />} />
        <Route path="/acceuil" element={<UserHome />} />

      </Routes>
    <Home/>
    </div>
  );
}

export default App;
